import React, { useState } from 'react';
import './App.css';
import Header from './Header'; 
import Section01 from './Section01';
import MapContainer from './MapContainer';


function App() {
  return (
    <div className="App">
      <Header></Header>
      <Section01>
        {MapContainer}
      </Section01>
    </div>
  );
}

export default App;
